import React from 'react'
import { Form, Input, Button } from 'antd';
import { toast } from '../../Common/utils';
import { useHistory } from "react-router-dom";
import loginImg from "../../images/2.jpeg"
import "./login.css"


const Login = (props) => {
    const history = useHistory();
    const onFinish = (values) => {

    };

    const onFinishFailed = (error) => {
        console.log('Failed:', error);
    };

    return (
        <div className="outer">
            <section>
                <div class="container">
                    <div class="user signinBx">
                        <div class="imgBx"><img src={loginImg} alt="" /></div>
                        <div class="formBx">
                        <h2>Sign In</h2>
                            <Form
                                name="login"
                                // labelCol={{ span: 8 }}
                                // wrapperCol={{ span: 16 }}
                                onFinish={onFinish}
                                colon={false}
                                requiredMark={false}
                                onFinishFailed={onFinishFailed}
                            >
                                <Form.Item
                                    label="Email"
                                    name="email"
                                    rules={[{ required: true, message: 'Please enter email!' }]}
                                >
                                    <Input type="email" />
                                </Form.Item>

                                <Form.Item
                                    label="Password"
                                    name="password"
                                    rules={[{ required: true, message: 'Please enter password!' }]}
                                >
                                    <Input.Password />
                                </Form.Item>

                                <Form.Item >
                                    <Button type="primary" htmlType="submit">
                                        Submit
                                    </Button>
                                </Form.Item>
                            </Form>

                            {/* <form action="" onsubmit="return false;">
                                <h2>Sign In</h2>
                                <input type="text" name="" placeholder="Username" />
                                <input type="password" name="" placeholder="Password" />
                                <input type="submit" name="" value="Login" />
                                <p class="signup">
                                    Don't have an account ?
                                    <a href="#" onclick="toggleForm();">Sign Up.</a>
                                </p>
                            </form> */}
                        </div>
                    </div>
                    <div class="user signupBx">
                        <div class="formBx">
                            <form action="" onsubmit="return false;">
                                <h2>Create an account</h2>
                                <input type="text" name="" placeholder="Username" />
                                <input type="email" name="" placeholder="Email Address" />
                                <input type="password" name="" placeholder="Create Password" />
                                <input type="password" name="" placeholder="Confirm Password" />
                                <input type="submit" name="" value="Sign Up" />
                                <p class="signup">
                                    Already have an account ?
                                    <a href="#" onclick="toggleForm();">Sign in.</a>
                                </p>
                            </form>
                        </div>
                        <div class="imgBx"><img src="https://raw.githubusercontent.com/WoojinFive/CSS_Playground/master/Responsive%20Login%20and%20Registration%20Form/img2.jpg" alt="" /></div>
                    </div>
                </div>
            </section>

        </div>
    )
}

export default Login
